    const [selected, onSelected] = useState(0);

    return <Layout name='Gastos'>
        <IonSegment disabled={ selected!=0}><IonLabel>Tipo</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=1}><IonLabel>Descripcion</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=2}><IonLabel>Comprobante</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=3}><IonLabel>Resumen</IonLabel></IonSegment>
    </Layout>
}

export default Gastos;
